import React, { useState, useEffect } from 'react';
import axios from 'axios';

function FirewallRulesPage() {
  const [rules, setRules] = useState([]);
  const [ruleName, setRuleName] = useState("");
  const [sourceIp, setSourceIp] = useState("");
  const [action, setAction] = useState("DENY");

  // Kuralları çekmek için API isteği
  const fetchRules = async () => {
    try {
      const token = localStorage.getItem("token") || "";
      const resp = await axios.get("/api/firewall/rules", {
        headers: { Authorization: `Bearer ${token}` }
      });
      setRules(resp.data);
    } catch (error) {
      alert("Kural listesi alınamadı: " + (error.response?.data?.detail || error.message));
    }
  };

  // Yeni kural oluşturmak için API isteği
  const createRule = async () => {
    try {
      const token = localStorage.getItem("token") || "";
      await axios.post("/api/firewall/rules", {
        rule_name: ruleName,
        source_ip: sourceIp,
        action
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });
      alert("Kural eklendi!");
      // Ekleme sonrası listeyi güncelle
      fetchRules();
      // Form alanlarını sıfırla
      setRuleName("");
      setSourceIp("");
      setAction("DENY");
    } catch (error) {
      alert("Kural eklenemedi: " + (error.response?.data?.detail || error.message));
    }
  };

  // Sayfa açılır açılmaz kuralları çek
  useEffect(() => {
    fetchRules();
  }, []);

  return (
    <div className="container">
      <h2 className="my-4">Firewall Kural Yönetimi</h2>

      {/* Kural Ekleme Formu */}
      <div className="row mb-3">
        <div className="col-auto">
          <input
            className="form-control"
            placeholder="Kural İsmi"
            value={ruleName}
            onChange={(e) => setRuleName(e.target.value)}
          />
        </div>

        <div className="col-auto">
          <input
            className="form-control"
            placeholder="Kaynak IP"
            value={sourceIp}
            onChange={(e) => setSourceIp(e.target.value)}
          />
        </div>

        <div className="col-auto">
          <select
            className="form-select"
            value={action}
            onChange={(e) => setAction(e.target.value)}
          >
            <option value="DENY">DENY</option>
            <option value="ALLOW">ALLOW</option>
          </select>
        </div>

        <div className="col-auto">
          <button className="btn btn-primary" onClick={createRule}>
            Ekle
          </button>
        </div>
      </div>

      {/* Kural Listesi */}
      <table className="table table-striped">
        <thead>
          <tr>
            <th>İşlem</th>
            <th>Kural Adı</th>
            <th>Kaynak IP</th>
          </tr>
        </thead>
        <tbody>
          {rules.map((r) => (
            <tr key={r._id || r.id}>
              <td>{r.action}</td>
              <td>{r.rule_name}</td>
              <td>{r.source_ip}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default FirewallRulesPage;
